import gitLogo from "../assets/github.png";
import { Container } from "./styles";
import Input from "../components/Input";
import ItemRepo from "../components/ItemRepo";
import { useState } from "react";

function App() {

  useState
  return (
    <Container>
      <img src={gitLogo} width={72} height={72}/>
      <Input/>
      <ItemRepo/>
    </Container>
  );
}

export default App;
